// 508. Most Frequent Subtree Sum
//
// Given the root of a tree, you are asked to find the most frequent subtree sum. 
// The subtree sum of a node is defined as the sum of all the node values formed 
// by the subtree rooted at that node (including the node itself). So what is the 
// most frequent subtree sum value? If there is a tie, return all the values with 
// the highest frequency in any order.
//
// Examples 1
// Input:
//
//   5
//  /  \
// 2   -3
// return [2, -3, 4], since all the values happen only once, return all of them in 
// any order.
//
// Examples 2
// Input:
//
//   5
//  /  \
// 2   -5
// return [2], since 2 happens twice, however -5 only occur once.
//
// Note: You may assume the sum of values in any subtree is in the range of 32-bit 
// signed integer.

/**
 * Definition for a binary tree node.
 * function TreeNode(val) {
 *     this.val = val;
 *     this.left = this.right = null;
 * }
 */

function TreeNode(val) {
    this.val = val;
    this.left = this.right = null;
}

/**
 * Creates a tree from a list of integers. This tree is *not* a binary search tree. Nodes 
 * are inserted into the tree using level-order traversal of the tree.
 */
function createTreeFromList(list) {
    if (list.length === 0) {
        return;
    }

    let root = new TreeNode(list[0]);           // Process first element in list
    let nodes = new Array(root);                // Initialize the list of nodes with top level node (i.e. root node)
    let node;

    let i = 1;
    while (i < list.length) {                   // Each loop iteration processes both left and right child nodes
        node = nodes.shift();

        if ((node.left === null) && (list[i] !== null)) {
            node.left = new TreeNode(list[i]);
            nodes.push(node.left);
        }

        i++;
        if (i === list.length) {
            break;
        }

        if ((node.right === null) && (list[i] !== null)) {
            node.right = new TreeNode(list[i]);
            nodes.push(node.right);
        }

        i++;
    }

    return root;
}

/**
 * Performs a level-order traversal of the tree. For each node, calculates the sum of nodes
 * in the subtree at the given node, and adds the sum to the list of sums. When the entire
 * tree has been traversed, a list of the most frequent sum(s) is returned.
 * 
 * @param {TreeNode} root
 * @return {number[]}
 */
var findFrequentTreeSum = function(root) {
    if (root === null) {
        return [];
    }

    let sums = {};
    let sum, highestFreqCount;
    let nodes = [root];
    let node;

    highestFreqCount = 0;

    while (nodes.length !== 0) {
        node = nodes.shift();
        if (node.left !== null) {
            nodes.push(node.left);
        }
        if (node.right !== null) {
            nodes.push(node.right);
        }

        sum = subTreeSum(node);
        if (sum in sums) {
            sums[sum]++;
        } else {
            sums[sum] = 1;
        }

        if (sums[sum] > highestFreqCount) {
            highestFreqCount = sums[sum];
        }
    }

    let result = [];
    for (sum in sums) {
        if (sums[sum] === highestFreqCount) {
            result.push(Number.parseInt(sum));
        }
    }

    return result;
};

/**
 * Recursive function to calculate the sum of the tree at the given root.
 */
function subTreeSum(root) {
    if (root === null) {
        return 0;
    }

    return root.val + subTreeSum(root.left) + subTreeSum(root.right);
}

